ireitos autorais, patentes ou marcas registradas de terceiros;</li>\r\n<li>Os Coment&aacute;rios n&atilde;o cont&eacute;m material difamat&oacute;rio, injurioso, ofensivo, indecente ou de alguma forma il&iacute;cito, que &eacute; invas&atilde;o de privacidade.</li>\r\n<li>Os Coment&aacute;rios n&atilde;o ser&atilde;o usados para solicitar ou promover neg&oacute;cios ou apresentar atividades comerciais ou atividades il&iacute;citas.</li>\r\n</ul>\r\n<p>Voc&ecirc; por meio deste concede a Montenegro a licen&ccedil;a n&atilde;o-exclusiva de usar, reproduzir, editar e autorizar outros a usar, reproduzir ou editar qualquer um de seus Coment&aacute;rios em qualquer e todas as formas, formatos e m&iacute;dias.</p>\r\n<h4>Cria&ccedil;&atilde;o de links para nosso conte&uacute;do</h4>\r\n<p>As seguintes organiza&ccedil;&otilde;es podem criar links para nosso Site sem a necessidade de aprova&ccedil;&atilde;o pr&eacute;via por escrito:</p>\r\n<ul>\r\n<li>Ag&ecirc;ncias governamentais;</li>\r\n<li>Mecanismos de busca;</li>\r\n<li>Organiza&ccedil;&otilde;es de m&iacute;dia;</li>\r\n<li>Distribuidores de diret&oacute;rios online podem inserir links para nosso Site na mesma maneira que inserem hiperlinks para Sites de outras empresas listadas; e</li>\r\n<li>Empresas credenciadas, exceto organiza&ccedil;&otilde;es angariantes sem fins lucrativos e grupos de arrecada&ccedil;&atilde;o de fundos para institui&ccedil;&otilde;es de caridade, que n&atilde;o podem inserir links para nosso Site sem aprova&ccedil;&atilde;o pr&eacute;via.</li>\r\n</ul>\r\n<p>Essas organiza&ccedil;&otilde;es podem postar links para nossa p&aacute;gina inicial, nossas publica&ccedil;&otilde;es ou outras informa&ccedil;&otilde;es do Site, contanto que o link: (a) n&atilde;o seja, de forma alguma, enganoso; (b) n&atilde;o insinue falsamente a exist&ecirc;ncia de uma rela&ccedil;&atilde;o de patroc&iacute;nio, endosso, ou aprova&ccedil;&atilde;o nossa a produtos e/ou servi&ccedil;os; e (c) seja apropriado ao contexto em que est&aacute; sendo inserido.</p>\r\n<p>N&oacute;s podemos considerar e aprovar solicita&ccedil;&otilde;es de link feitas pelos seguintes tipos de organiza&ccedil;&otilde;es:</p>\r\n<ul>\r\n<li>fontes de informa&ccedil;&atilde;o bem conhecidas sobre produtos e neg&oacute;cios;</li>\r\n<li>sites comunit&aacute;rios ponto.com;</li>\r\n<li>associa&ccedil;&otilde;es e outros grupos que representem isntitui&ccedil;&otilde;es de caridade;</li>\r\n<li>distribuidores de diret&oacute;rios online;</li>\r\n<li>portais de internet;</li>\r\n<li>firmas de contabilidade, advocacia e consultoria; e</li>\r\n<li>institui&ccedil;&otilde;es educacionais e associa&ccedil;&otilde;es de classe.</li>\r\n</ul>\r\n<p>N&oacute;s vamos aprovar solicita&ccedil;&otilde;es de link feitas pelos tipos de organiza&ccedil;&atilde;o listados acima se julgarmos que: (a) o link n&atilde;o &eacute; desfavor&aacute;vel para nossa imagem e/ou para a imagem de empresas credenciadas; (b) a organiza&ccedil;&atilde;o solicitante n&atilde;o possui hist&oacute;rico negativo conosco; (c) o benef&iacute;cio que ganhamos com a visibilidade do link compensa a aus&ecirc;ncia do Montenegro; e (d) o link ser&aacute; inserido em um contexto geral informativo.</p>\r\n<p>Essas organiza&ccedil;&otilde;es podem postar links para nossa p&aacute;gina inicial contanto que o link: (a) n&atilde;o seja, de forma alguma, enganoso; (b) n&atilde;o insinue falsamente a exist&ecirc;ncia de uma rela&ccedil;&atilde;o de patroc&iacute;nio, endosso, ou aprova&ccedil;&atilde;o de produtos e/ou servi&ccedil;os da nossa parte; e (c) seja apropriado ao contexto em que est&aacute; sendo inserido.</p>\r\n<p>Se voc&ecirc; representa uma das organiza&ccedil;&otilde;es listadas no par&aacute;grafo 2 acima e est&aacute; interessado em postar um link para nosso site, voc&ecirc; deve nos informar de seu interesse enviando um e-mail para Montenegro. Por favor, inclua seu some, o nome da sua organiza&ccedil;&atilde;o e suas informa&ccedil;&otilde;es de contato, assim como a URL do seu site, uma lista das URLs do nosso site que voc&ecirc; pretende usar como links, e uma lista dos sites nos quais voc&ecirc; pretende publicar nossas URLs. Aguarde entre 2 e 3 semanas para receber uma resposta.</p>\r\n<p>Organiza&ccedil;&otilde;es aprovadas poder&atilde;o publicar links para nosso Site das seguintes formas:</p>\r\n<ul>\r\n<li>Usando nosso nome corporativo; ou</li>\r\n<li>Usando a URL para onde o link redireciona; ou</li>\r\n<li>Usando qualquer outra descri&ccedil;&atilde;o do nosso Site que fa&ccedil;a sentido dentro do contexto e do formato do conte&uacute;do onde o link est&aacute; sendo inserido.</li>\r\n</ul>\r\n<p>N&atilde;o ser&aacute; permitido o uso ou a publica&ccedil;&atilde;o de links para o logo e/ou outros elementos visuais da Montenegro sem um acordo de licen&ccedil;a para o uso da marca registrada.</p>\r\n<h4>Responsabiliza&ccedil;&atilde;o pelo Conte&uacute;do:</h4>\r\n<p>N&atilde;o seremos responsabilizados legalmente por qualquer conte&uacute;do que apare&ccedil;a em nosso Site. Voc&ecirc; concorda em nos proteger e nos defender contra todas as acusa&ccedil;&otilde;es que forem levantadas contra nosso Site. Nenhum link deve aparecer em qualquer Site que possa ser interpretado como difamat&oacute;rio, obsceno, criminoso, ou que infrinja, viole ou defenda a viola&ccedil;&atilde;o dos direitos de terceiros.</p>\r\n<h4>Reserva de Direitos:</h4>\r\n<p>Reservamos nosso direito de solicitar que voc&ecirc; remova todos os links ou quaisquer links que redirecionem para nosso site. Voc&ecirc; concorda em remover imediatamente todos os links para nosso site assim que a remo&ccedil;&atilde;o for solicitada. Tamb&eacute;m reservamos nosso direito de corrigir e alterar estes termos e condi&ccedil;&otilde;es a qualquer momento. Ao publicar continuadamente links para nosso site, voc&ecirc; concorda a seguir estes termos e condi&ccedil;&otilde;es sobre links.</p>\r\n<h4>Remo&ccedil;&atilde;o de links postados em nosso site:</h4>\r\n<p>Se voc&ecirc; encontrar qualquer link em nosso Site que seja de qualquer forma ofensivo, voc&ecirc; tem a liberdade de entrar em contato conosco e nos informar do problema a qualquer momento. Vamos considerar as solicita&ccedil;&otilde;es de remo&ccedil;&atilde;o de links, mas n&atilde;o somos obrigados a remover quaisquer links do nosso site nem a responder diretamente &agrave; sua solicita&ccedil;&atilde;o.</p>\r\n<p>N&oacute;s n&atilde;o garantimos que as informa&ccedil;&otilde;es continas neste site s&atilde;o corretas. N&oacute;s n&atilde;o garantimos integralidade ou exatid&atilde;o do conte&uacute;do. N&atilde;o garantimos que o site se manter&aacute; dispon&iacute;vel ou que o material do site se manter&aacute; atualizado.</p>\r\n<h4>Declara&ccedil;&atilde;o de Isen&ccedil;&atilde;o de Responsabilidade:</h4>\r\n<p>No m&aacute;ximo poss&iacute;vel permitido por lei, n&oacute;s exclu&iacute;mos todas as representa&ccedil;&otilde;es, garantias e condi&ccedil;&otilde;es relativas ao nosso site e ao uso deste site. Nada nesta declara&ccedil;&atilde;o de isen&ccedil;&atilde;o de responsabilidade vai:</p>\r\n<ul>\r\n<li>limitar ou excluir nossa responsabilidade ou sua responsabilidade por mortes ou danos pessoais;</li>\r\n<li>limitar ou excluir nossa responsabilidade ou sua responsabilidade por fraudes ou deturpa&ccedil;&otilde;es fraudulentas;</li>\r\n<li>limitar nossa responsabilidade ou sua responsabilidade de quaisquer maneiras que n&atilde;o forem permitidas sob a lei; excluir quaisquer responsabilidades suas ou nossas que n&atilde;o podem ser exclu&iacute;das de acordo com a lei aplic&aacute;vel.</li>\r\n</ul>\r\n<p>As limita&ccedil;&otilde;es e proibi&ccedil;&otilde;es de responsabiliza&ccedil;&atilde;o listadas nesta Se&ccedil;&atilde;o e em outras partes desta declara&ccedil;&atilde;o: (a) est&atilde;o sujeitas ao par&aacute;grafo anterior; e (b) regem todas as responsabiliza&ccedil;&otilde;es que surgirem sob a declara&ccedil;&atilde;o, incluindo responsabiliza&ccedil;&otilde;es surgidas em contrato, em delitos e em quebra de obriga&ccedil;&otilde;es legais.</p>\r\n<p>Enquanto o site e as informa&ccedil;&otilde;es e servi&ccedil;os do site forem oferecidos gratuitamente, n&oacute;s n&atilde;o seremos respons&aacute;veis por perdas e danos de qualquer natureza.</p>'),
